            <Image
                src="/public/Adamedia-Design-Logo.png"
                alt="Picture of the author"
                width={50}
                height={50}
            />
            </div>

            <div className='rightNavItems'>
                Right
            </div>

        </div>
    )
}




export default MainNav;
